/**
 * Load page. Tiny. Waits for loading of main part of splitted code
 * @file
 */

import React, { Component } from "react";

const gif = 'data:image/gif;base64,';

const styles = {
  frame: {
    display: 'flex',
    position: 'absolute',
    width: '100%',
    height: '100%',
    justifyContent: 'center',
    alignItems: 'center',
  },
  container: {
    display: 'flex',
    flexDirection: 'column',
    width: '500px',
    height: '200px',
    backgroundColor: 'white',
    justifyContent: 'flex-start',
    alignItems: 'center',
    border: '1px solid, gray',
  },
  image: {
    height: '100px',
  },
  text: {
    paddingTop: '25px',
    fontSize: '20px',
    fontFamily: 'Arial, sans-serif',
  },
};

class Loader extends Component {
  state = {
    visible: true,
  };

  componentDidMount() {
    document.addEventListener('applicationLoaded', () => this.setState({ visible: false }));
  }

  render() {
    return (
      this.state.visible &&
      <div style={styles.frame}>
        <div style={styles.container}>
          <img style={styles.image} src={gif} alt="book"/>
          <div style={styles.text}>Додаток завантажується...</div>
        </div>

      </div>
    );
  }
}

export default Loader;
